// ==UserScript==
// @name        滚动条增强：放大 + 右键回顶部
// @namespace   移入滚动条放大,右键滚动到顶部
// @match       *://*/*
// @grant       none
// @version     1.0
// @author      木木
// @description 在网页中全局生效：鼠标移入任意滚动容器自动放大滚动条，右键点击该容器平滑滚动到顶部。
// @license     MIT
// @icon        data:image/jpeg;base64,
// @downloadURL https://update.greasyfork.org/scripts/550649/%E6%BB%9A%E5%8A%A8%E6%9D%A1%E5%A2%9E%E5%BC%BA%EF%BC%9A%E6%94%BE%E5%A4%A7%20%2B%20%E5%8F%B3%E9%94%AE%E5%9B%9E%E9%A1%B6%E9%83%A8.user.js
// @updateURL https://update.greasyfork.org/scripts/550649/%E6%BB%9A%E5%8A%A8%E6%9D%A1%E5%A2%9E%E5%BC%BA%EF%BC%9A%E6%94%BE%E5%A4%A7%20%2B%20%E5%8F%B3%E9%94%AE%E5%9B%9E%E9%A1%B6%E9%83%A8.meta.js
// ==/UserScript==
(function () {
    // 全局放大滚动条的样式（WebKit 内核）
    const style = document.createElement('style');
    style.innerHTML = `
      .scrollbar-hover::-webkit-scrollbar {
        width: 16px !important;
        height: 16px !important;
      }
      .scrollbar-hover::-webkit-scrollbar-thumb {
        background-color: rgba(0,0,0,0.6) !important;
        border-radius: 8px !important;
      }
    `;
    document.head.appendChild(style);

    document.addEventListener('mouseover', (e) => {
        const el = e.target;
        if (el.scrollHeight > el.clientHeight || el.scrollWidth > el.clientWidth) {
            el.classList.add('scrollbar-hover');
        }
    });

    document.addEventListener('mouseout', (e) => {
        const el = e.target;
        el.classList.remove('scrollbar-hover');
    });

    // 平滑滚动到顶部函数
    function smoothScrollToTop(el, duration = 400) {
        const start = el.scrollTop;
        const startTime = performance.now();

        function animate(time) {
            const elapsed = time - startTime;
            const progress = Math.min(elapsed / duration, 1);
            // 使用ease-out缓动
            const ease = 1 - Math.pow(1 - progress, 3);
            el.scrollTop = start * (1 - ease);

            if (progress < 1) {
                requestAnimationFrame(animate);
            }
        }

        requestAnimationFrame(animate);
    }

    // 右键滚动到顶部
    document.addEventListener('contextmenu', (e) => {
        const el = e.target;
        if (el.scrollHeight > el.clientHeight || el.scrollWidth > el.clientWidth) {
            smoothScrollToTop(el, 500); // 500ms 动画
            e.preventDefault(); // 阻止默认右键菜单
        }
    });

})()